    def power_of(self, g, n):
        """
        computes the conjugacy class of g^n
        """
        q = self.q
        d = self.d
        s = q - _sage_const_1 
        r = (q + _sage_const_1 ) // d
        tp = self.tp
        rp = self.rp
        p = self.characteristic
        i = int(g[_sage_const_2 ])

        # initialize
        k,l,m = _sage_const_0 ,_sage_const_0 ,_sage_const_0  

        # string handling to recover indices from string
        # we'll use this when computing characters, but annoying to package as a function
        if i in [_sage_const_3 ,_sage_const_4 ,_sage_const_5 ,_sage_const_7 ,_sage_const_8 ]:
            k = int(g[_sage_const_4 :])
        elif i == _sage_const_6  and g[-_sage_const_1 ] != "'":
            k,l,m = map(int,g[_sage_const_5 :-_sage_const_1 ].split(','))

        # power map logic
        if i == _sage_const_1 :
            return "C_1"
        elif i == _sage_const_2 :
            if n%p == _sage_const_0 :
                return "C_1"
            return "C_2"
        elif i == _sage_const_3 :
            if self.characteristic == _sage_const_2 :
                if n%_sage_const_4  == _sage_const_0 :
                    return "C_1"
                elif n%_sage_const_2  == _sage_const_0 :
                    return "C_2"
                else:
                    return g 
            else:
                if n%self.characteristic == _sage_const_0 :
                    return "C_1"
                else:
                    return g 
        elif i == _sage_const_4 :
            e = (n*k) % ((q+_sage_const_1 )//d)
            if e == _sage_const_0 :
                return "C_1"
            else:
                return f"C_4^{e}"
        elif i == _sage_const_5 :
            if k*n % ((q+_sage_const_1 )//d) == _sage_const_0  and n%p == _sage_const_0  :
                return "C_1"
            elif k*n % ((q+_sage_const_1 )//d) == _sage_const_0 :
                return "C_2"
            elif n % p == _sage_const_0 :
                return f"C_4^{n * k % rp}" # added 7/15--might not  work
            return f"C_5^{k*n % ((q+_sage_const_1 )//d)}"
        elif i == _sage_const_6 :
            # Logic for C_6'
            if g[-_sage_const_1 ] == "'":
                if n%_sage_const_3  == _sage_const_0 :
                    return "C_1"
                return "C_6'"
            # Logic for C_6^{k,l,m}
            diag = [(n*x)%((q+_sage_const_1 )) for x in (k,l,m)] # ((q+1)//d) ?
            k,l,m = sorted([ (q+_sage_const_1 ) if x == _sage_const_0  else x for x in diag])  # ((q+1)//d) ?

            if (k,l,m) == ((q+_sage_const_1 )//d, _sage_const_2  * ((q+_sage_const_1 )//d),  (q+_sage_const_1 )): # checks for C_6'
                return "C_6'" 
            while l > (q+_sage_const_1 )//d:
                diag  = [(x + (q+_sage_const_1 )//d)%(q+_sage_const_1 ) for x in (k,l,m)]
                k,l,m = sorted([ (q+_sage_const_1 ) if x == _sage_const_0  else x for x in diag])
                

            if k == l or l == m: # broke the rules!
                return self.power_of(f"C_4^1", l) # what's up with this?
            return f"C_6^{{{k},{l},{m}}}"
        elif i == _sage_const_7 :
            if k*n % (s*rp) == _sage_const_0 :
                return "C_1"
            elif k*n % s == _sage_const_0 :
                return f"C_4^{sorted([s*k*n % (s*rp), k*n % (s*rp), (-q*k*n) % (s*rp)])[_sage_const_1 ] // s}"
            y = k*n % (s*rp)
            y = min(y, (-q*y) % (s*rp))
            return f"C_7^{y}"
        elif i == _sage_const_8 :
            if k*n % tp == _sage_const_0 :
                return "C_1"
            w = k*n % tp
            w = min(w, w*(-q) % tp, w*q*q % tp)
            return f"C_8^{w}"
    
